function UserAnimals({user}) {

    useEffect(() => {
        fetch("/my_account/animals")
        .then((res) => res.json())
        .then((res) => console.log(res))
    })

    return (
        <h1>{user.username} Animals</h1>
    )
}

export default UserAnimals;
